column8:
対称形の小型サイズで使いやすい有線光学式マウス<br />光学センサーが動きを読み取るので、正確で自然な動きを実現し、使うシーンを選びません。ボールレスなのでクリーニングが不要です。<br />
差し込むだけで使える手間なし簡単接続です。Windows標準ドライバでスクロール機能がそのまま使えるので、面倒なソフトのインストールが不要です。<br />
手首一振りで画面の端までカーソル移動が可能な1000カウント高分解能で、エクセルなどの表計算も快適です。<br />
小型サイズの対称形デザインで、携帯にも便利です。<br />
開梱しやすく、開梱後のゴミを減らすことができる紙箱パッケージです。<br />●色:ホワイト<br />
●インターフェース:USBHID仕様バージョン1.1準拠<br />
※USB3.0/2.0インターフェースでもご使用になれます。<br />
●分解能:1000カウント/インチ<br />
●読み取り方式:光学センサー方式<br />
●ボタン:2ボタン、ホイール(スクロール)ボタン<br />
●サイズ:W48×D90×H30mm<br />
●重量:約45g<br />
●ケーブル長:1.2m<br />
●付属品:取扱説明書<br />
<br />
●対応機種<br />
Windows搭載(DOS/V)パソコン、AppleMacシリーズ<br />
※USBポート(Aタイプコネクタ)を持つ機種。<br />
<br />
●対応OS<br />
Windows10・8.1・8・7・Vista・XP、WindowsRT、MacOSX(10.2以降)<br />
※MacOSX(10.3以降)は、標準インストールされているSafari、Mail、テキストエディット、及びFinderなど、OS標準ドライバでスクロール可能なアプリケーションでのみスクロール可能です。またホイールボタン押下げによる動作はサポートしません。<br />
※機種により対応できないものもあります。<br />
※この文章中に表記されているその他すべての製品名などは、それぞれのメーカーの登録商標、商標です。<style type="text/css">





